import React from "react";
import Entry from "./Entry";
import Emojis from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <Entry emoji={Emojis[0].emoji} name={Emojis[0].name} meaning={Emojis.meaning} />
    </div>
  );
}

export default App;
